export default function App() {
  const [state, setState] = useState("inception");

  const key = "8e10d7fe";

  useEffect(function () {
    async function getMovieData() {
      const res = await fetch(
        `http://www.omdbapi.com/?apikey=${key}&i=${state}`
      );

      const data = await res.json();

      console.log(data);
    }
  });

  ApiComponent();
}
